import React from 'react';
import Head from 'next/head';
import Layout from '../components/Layout';

const Home = () => {
    return(
        <>
            <Layout class="Inicio">
                <Head>
                    <title>Inicio</title>
                </Head>         
            </Layout>
            <div>
                <h1>Uso de Next y React</h1> 
                <p>Vista de los personajes</p>
                <img src="/img/rickMorty.png" alt="img rick aand morty"></img>
            </div>
        <style jsx>{`
            div{
                background: #2F3540;
                width: calc(100% + 1.5em);
                height: 80vh;
                display: column;                
                margin: -1em;
                padding: -1;
            }
            h1{
                color: #F2F2F2;
                text-align: center;
                padding:1em;
            }
            p{
                color: #F2F2F2;
                font-size: 18px;
                text-align: center;
                padding: 0 0 3em;
            }
            img{
                display: block;
                width: 80%;
                margin: auto;
            }
        `}</style>
        </>
    )
}
export default Home;
